import React from 'react';
import { Outlet, useRoutes } from 'react-router-dom';
import Login from './pages/Login';

// define routes
const Routes = () => {
  const route = useRoutes([
    {
      element: <App />,
      path: '/',
      children: [
        {
          path: '/',
          element: <Login />
        },
      ]
    }
  ])
  return route
}


function App() {
  return (
    <React.Fragment>
      <Outlet/>
    </React.Fragment>
  )
}

export default App;
